package com.mobile.model;/** * √Ë ˆ‘±π§ */public class Employee {    private String Eid;    private String Epwd;    private String Ename;    private String Esex;    private String Edept;    private String Eduty;    private String Enum;    private String Eemail;    private String Etel;    private String Eip;    private String Eauthority;    public Employee(){    }    public Employee(String eid,String epwd){        this.Eid = eid;        this.Epwd = epwd;    }    public String getEid() {        return Eid;    }    public void setEid(String eid) {        Eid = eid;    }    public String getEpwd() {        return Epwd;    }    public void setEpwd(String epwd) {        Epwd = epwd;    }    public String getEname() {        return Ename;    }    public void setEname(String ename) {        Ename = ename;    }    public String getEsex() {        return Esex;    }    public void setEsex(String esex) {        Esex = esex;    }    public String getEdept() {        return Edept;    }    public void setEdept(String edept) {        Edept = edept;    }    public String getEduty() {        return Eduty;    }    public void setEduty(String eduty) {        Eduty = eduty;    }    public String getEnum() {        return Enum;    }    public void setEnum(String anEnum) {        Enum = anEnum;    }    public String getEemail() {        return Eemail;    }    public void setEemail(String eemail) {        Eemail = eemail;    }    public String getEtel() {        return Etel;    }    public void setEtel(String etel) {        Etel = etel;    }    public String getEip() {        return Eip;    }    public void setEip(String eip) {        Eip = eip;    }    public String getEauthority() {        return Eauthority;    }    public void setEauthority(String eauthority) {        Eauthority = eauthority;    }}